import GlobalStyles from '../src/styles/GlobalStyles';
import Head from 'next/head';

import "../config/i18n";
import "isomorphic-fetch";

export default function MyApp({ Component, pageProps }) {
  return (
  <>
    <GlobalStyles/>
    <Head>
        <meta charset="utf-8" />
        <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
        <meta name="viewport" content="width=device-width, initial-scale=1" />
        <title>Obrigado!</title>
        <link href='https://fonts.googleapis.com/css?family=Lato:300,400|Montserrat:700' rel='stylesheet' type='text/css' />
        <style jsx> {`
            * { background: #3b3b3b !important; color: white !important; }
            @import url(//cdnjs.cloudflare.com/ajax/libs/normalize/3.0.1/normalize.min.css);
            @import url(//maxcdn.bootstrapcdn.com/font-awesome/4.2.0/css/font-awesome.min.css);
        `}

        </style>
        <link rel="stylesheet" href="https://2-22-4-dot-lead-pages.appspot.com/static/lp918/min/default_thank_you.css" />
        <script src="https://2-22-4-dot-lead-pages.appspot.com/static/lp918/min/jquery-1.9.1.min.js"></script>
        <script src="https://2-22-4-dot-lead-pages.appspot.com/static/lp918/min/html5shiv.js"></script>
    </Head>
    <body>
        <header class="site-header" id="header">
            <i class="fa fa-check main-content__checkmark" id="checkmark"></i>
            <h1 class="site-header__title" data-lead-id="site-header-title">Compra Efetuada!</h1>
        </header>

        <div class="main-content">
            <p class="main-content__body" data-lead-id="main-content-body">Obrigado por comprar com a gente! Agora basta entrar em contato conosco pelo whatsapp ou e-mail que vamos prosseguir com seu boost!</p>
        </div>

        <footer class="site-footer" id="footer">
            <p class="site-footer__fineprint" id="fineprint">Copyright ©2020 | All Rights Reserved</p>
        </footer>
    </body>
  </>
  );
}
